import React from 'react'
import Tilt from 'react-tilt'
import './Logo.css'
import icon from './icon.png'
import ModalPassword from './ModalPassword'
import { Modal } from 'react-bootstrap'

handleModal =(id) =>{
    this.setState({show:true});
    this.setCurrentId(id);      
}

setCurrentId = (id) => {
    this.setState({currentNoteID: id});
}
handleClose = () => { 
    this.setState({ show: false,alert:false });
    //console.log("show : " +this.props.show);
}

const Logo = () =>{



    return(
        <div className="ma4 mt0">
            <ModalPassword />
            <Tilt onClick={()=> {this.handleModal() }} className="Tilt br2 shadow-2" options={{ max : 55 }} style={{ height: 150, width: 150 }} >
                <div className="Tilt-inner pa3"><img style={{paddingTop:'5px'}} alt='logo' src={icon}/></div>
            </Tilt>
        </div>
    )
}

export default Logo
